        [OneTimeSetUp]
        public void Inicialize()
        {
            listaSociosMigradas = new List<Socio>();
            listaEmpleadosMigradas = new List<Empleado>();
        }

        [OneTimeTearDown]
        public void Limpieza()
        {
            using (var context = new DiagramasDeTablasContainer1())
            {
                if (listaSociosMigradas != null) { 
                    context.Socios.RemoveRange(context.Socios.AsEnumerable().Where(b => listaSociosMigradas.Select(s => s.IdSocio).Contains(b.IdSocio)).ToList());
                    context.Personas.RemoveRange(context.Personas.AsEnumerable().Where(b => listaSociosMigradas.Select(s => s.Persona.IdPersona).Contains(b.IdPersona)));
                }
                if (listaEmpleadosMigradas != null) { 
                    context.Empleados.RemoveRange(context.Empleados.AsEnumerable().Where(b => listaEmpleadosMigradas.Select(s => s.IdEmpleado).Contains(b.IdEmpleado)).ToList());
                    context.Personas.RemoveRange(context.Personas.AsEnumerable().Where(b => listaEmpleadosMigradas.Select(s => s.Persona.IdPersona).Contains(b.IdPersona)));
                }
                
                context.ValorCuotaInicials.Remove(context.ValorCuotaInicials.AsEnumerable().FirstOrDefault(b => b.IdCuotaInicial == (new ControladorSocio().UltimoValorInicialClub()).IdCuotaInicial));
                context.SaveChanges();
            }
        }

